public class Solution {
    public int maxFrequency(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        int res = 0;
        for (int i = 0; i < n; i++) {
            int left = i, right = n - 1;
            while (left <= right) {
                int mid = left + (right - left) / 2;
                if (nums[mid] * (mid - i + 1) > k) {
                    right = mid - 1;
                } else {
                    int curK = nums[mid] * (mid - i + 1);
                    if (curK <= k) {
                        res = Math.max(res, nums[mid]);
                        left = mid + 1;
                    } else {
                        right = mid - 1;
                    }
                }
            }
        }
        return res;
    }
}

