public class Solution {
    public char[][] rotateTheBox(char[][] box) {
        int m = box.length;
        int n = box[0].length;

        // Transpose the matrix
        char[][] rotatedBox = new char[n][m];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                rotatedBox[j][i] = box[i][j];
            }
        }

        // Reverse each row
        for (int i = 0; i < n; i++) {
            for (int j = m - 1; j >= 0; j--) {
                rotatedBox[i][j] = box[j][i];
            }
        }

        return rotatedBox;
    }
}

