public class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int maxSide = Math.min(m, n);
        int maxSize = 0;

        for (int side = 1; side <= maxSide; side++) {
            for (int i = 0; i + side - 1 < m; i++) {
                for (int j = 0; j + side - 1 < n; j++) {
                    if (isMagic(grid, i, j, side)) {
                        maxSize = Math.max(maxSize, side);
                    }
                }
            }
        }

        return maxSize;
    }

    private boolean isMagic(int[][] grid, int i, int j, int side) {
        // Check rows
        for (int k = 0; k < side; k++) {
            int rowSum = 0;
            for (int l = 0; l < side; l++) {
                rowSum += grid[i + k][j + l];
            }
            if (!Arrays.stream(IntStream.range(0, side).map(i -> rowSum).toArray()).allMatch(a -> a == rowSum)) {
                return false;
            }
        }

        // Check columns
        for (int k = 0; k < side; k++) {
            int colSum = 0;
            for (int l = 0; l < side; l++) {
                colSum += grid[i + k][j + l];
            }
            if (!Arrays.stream(IntStream.range(0, side).map(i -> colSum).toArray()).allMatch(a -> a == colSum)) {
                return false;
            }
        }

        // Check diagonals
        int diagonal1 = 0;
        for (int k = 0; k < side; k++) {
            diagonal1 += grid[i + k][j + k];
        }
        if (!Arrays.stream(IntStream.range(0, side).map(i -> diagonal1).toArray()).allMatch(a -> a == diagonal1)) {
            return false;
        }

        int diagonal2 = 0;
        for (int k = 0; k < side; k++) {
            diagonal2 += grid[i + k][j + side - k - 1];
        }
        if (!Arrays.stream(IntStream.range(0, side).map(i -> diagonal2).toArray()).allMatch(a -> a == diagonal2)) {
            return false;
        }

        return true;
    }
}

