public class Solution {
    public int niceDivisors(int primeFactors) {
        BigInteger n = new BigInteger("1");
        for (int i = 2; ; i++) {
            if (isPrime(i)) {
                List<BigInteger> factors = getPrimeFactors(i);
                if (factors.size() <= primeFactors) {
                    n = multiply(n, i);
                    break;
                }
            }
        }
        int count = 1;
        for (int i = 2; i <= n.intValue(); i++) {
            boolean isNice = true;
            for (BigInteger factor : getPrimeFactors(i)) {
                if (!n.testBit(factor.bitLength() - 1)) {
                    isNice = false;
                    break;
                }
            }
            if (isNice) {
                count++;
            }
        }
        return count % (new BigInteger("1000000007")).intValue();
    }

    private List<BigInteger> getPrimeFactors(int n) {
        List<BigInteger> factors = new ArrayList<>();
        for (int i = 2; ; i++) {
            if (isPrime(i)) {
                while (n % i == 0) {
                    factors.add(BigInteger.valueOf(i));
                    n /= i;
                }
                if (n == 1) {
                    break;
                }
            } else {
                break;
            }
        }
        return factors;
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; ; i++) {
            if (i * i > n) {
                return true;
            } else if (n % i == 0) {
                return false;
            }
        }
    }

    private BigInteger multiply(BigInteger a, int b) {
        return a.multiply(BigInteger.valueOf(b));
    }
}

