        boolean[] seen = new boolean[n];
        while (true) {
            int[] perm = new int[n];
            for (int i = 0; i < n; i++) {
                if (i % 2 == 0) {
                    perm[i] = i / 2;
                } else {
                    perm[i] = n / 2 + (i - 1) / 2;
                }
            }
            boolean changed = false;
            for (int i = 0; i < n; i++) {
                if (!seen[perm[i]]) {
