import java.util.*;

public class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        Map<String, Integer> colorCount = new HashMap<>();
        for (int[] edge : edges) {
            int a = edge[0], b = edge[1];
            graph[a].add(b);
        }
        for (int i = 0; i < n; i++) {
            colorCount.put(colors.charAt(i), colorCount.getOrDefault(colors.charAt(i), 0) + 1);
        }

        boolean[] visited = new boolean[n];
        int maxPathValue = -1;
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                Arrays.fill(visited, false);
                int pathValue = dfs(graph, colors, colorCount, visited, i, 0);
                maxPathValue = Math.max(maxPathValue, pathValue);
            }
        }

        return maxPathValue;
    }

    private int dfs(List<Integer>[] graph, String colors, Map<String, Integer> colorCount, boolean[] visited, int node, int pathValue) {
        if (visited[node]) {
            return 0;
        }
        visited[node] = true;
        int maxColorCount = 0;
        for (int neighbor : graph[node]) {
            if (!visited[neighbor]) {
                String color = colors.charAt(neighbor);
                int newColorCount = Math.max(maxColorCount, colorCount.getOrDefault(color, 0));
                pathValue++;
                int newPathValue = dfs(graph, colors, colorCount, visited, neighbor, pathValue);
                if (newPathValue > 0) {
                    return 0;
                }
                pathValue--;
            } else {
                return 0;
            }
        }
        return newColorCount;
    }
}

