import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int shortestPathAllKeys(String[] stringGrid) {
        int m = stringGrid.length, n = stringGrid[0].length();
        char[][] grid = new char[m][n];
        for (int i = 0; i < m; i++) {
            stringGrid[i] += " ";
            for (int j = 0; j < n; j++) {
                grid[i][j] = stringGrid[i].charAt(j);
            }
        }

        int startX = -1, startY = -1;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == '@') {
                    startX = i;
                    startY = j;
                    break;
                }
            }
            if (startX != -1) break;
        }

        int[] dx = {-1, 1, 0, 0};
        int[] dy = {0, 0, -1, 1};

        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[m][n];
        int state = 0; // 0: no key, 1: has key
        queue.add(new int[]{startX, startY, state});
        visited[startX][startY] = true;

        int res = 0;
        while (!queue.isEmpty()) {
            int[] cur = queue.poll();
            int x = cur[0], y = cur[1], st = cur[2];

            if (st == 1) continue; // already has key

            for (int i = 0; i < 4; i++) {
                int nx = x + dx[i];
                int ny = y + dy[i];
                if (nx >= 0 && nx < m && ny >= 0 && ny < n && !visited[nx][ny]) {
                    visited[nx][ny] = true;
                    queue.add(new int[]{nx, ny, st});
                    if (grid[nx][ny] == '#') continue; // wall
                    if (Character.isLowerCase(grid[nx][ny])) { // key
                        state |= 1 << (grid[nx][ny] - 'a');
                        res++;
                    } else if (Character.isUpperCase(grid[nx][ny])) { // lock
                        if ((state & (1 << (grid[nx][ny] - 'A'))) == 0) continue; // no key for lock
                        state |= 1 << (grid[nx][ny] - 'a');
                    }
                }
            }
        }

        return res;
    }
}

