public class Solution {
    public int scoreOfParentheses(String s) {
        Deque<Integer> stack = new ArrayDeque<>();
        stack.push(0);
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '(') {
                stack.push(0);
            } else {
                int top = stack.pop();
                if (!stack.isEmpty() && stack.peek() == 1) {
                    stack.pop();
                    stack.push(2 * top);
                } else {
                    stack.push(top + 2);
                }
            }
        }
        return stack.pop();
