import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= num.length() / 2 + 1; i++) {
            String prefix = num.substring(0, i);
            if (!isValid(prefix)) continue;
            int val = Integer.parseInt(prefix);
            if (val > Integer.MAX_VALUE) break;
            List<Integer> temp = new ArrayList<>();
            temp.add(val);
            for (int j = i + 1; j <= num.length(); j++) {
                String suffix = num.substring(i, j);
                if (!isValid(suffix)) break;
                int nextVal = val + temp.get(temp.size() - 1);
                if (Integer.parseInt(suffix) != nextVal) break;
                temp.add(nextVal);
            }
            if (temp.size() >= 3) {
                result.addAll(temp);
                return result;
            }
        }
        return new ArrayList<>();
    }

    private boolean isValid(String s) {
        if (s.length() > 1 && s.startsWith("0")) return false;
        for (int i = 0; i < s.length(); i++) {
            if (!Character.toString(s.charAt(i)).matches("[0-9]")) return false;
        }
        return true;
    }
}

