public class Solution {
    public int binaryGap(int n) {
        String bin = Integer.toBinaryString(n);
        int maxDist = 0;
        int prevOne = -1;

        for (int i = 0; i < bin.length(); i++) {
            if (bin.charAt(i) == '1') {
                if (prevOne != -1) {
                    maxDist = Math.max(maxDist, i - prevOne);
                }
                prevOne = i;
            }
        }

        return maxDist;
    }
}

