import java.util.Arrays;

public class Solution {
    public int superEggDrop(int k, int n) {
        int[][] dp = new int[k + 1][n + 1];
        for (int i = 0; i <= k; i++) {
            Arrays.fill(dp[i], 0);
        }
        for (int i = 1; i <= k; i++) {
            for (int j = 1; j <= n; j++) {
                dp[i][j] = Math.max(dp[i - 1][j - 1] + 1, dp[i][j - 1]);
                if (dp[i][j] >= j) {
                    break;
                }
            }
        }
        return dp[k][n];
    }
}

