import java.util.Arrays;

public class Solution {
    public double largestSumOfAverages(int[] nums, int k) {
        int n = nums.length;
        double[] prefixSum = new double[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }

        double[][] dp = new double[k + 1][n + 1];
        for (int i = 1; i <= k; i++) {
            for (int j = i; j <= n; j++) {
                if (i == 1) {
                    dp[i][j] = prefixSum[j] / (double) (j - i + 1);
                } else {
                    double max = Double.NEG_INFINITY;
                    for (int x = i - 1; x < j; x++) {
                        max = Math.max(max, dp[i - 1][x] + (prefixSum[j] - prefixSum[x]) / (double) (j - x));
                    }
                    dp[i][j] = max;
                }
            }
        }

        return dp[k][n];
    }
}

