import java.util.Stack;

public class Solution {
    public String decodeAtIndex(String s, int k) {
        long length = 0;
        StringBuilder tape = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                tape.append(c);
            } else {
                int repeat = Integer.parseInt(String.valueOf(c));
                tape = new StringBuilder(new String(tape).repeat(repeat - 1));
            }
            length++;
        }

        k %= length;
        for (int i = 0; i < tape.length(); i++) {
            if (Character.isLetter(tape.charAt(i))) {
                if (k == 1) return String.valueOf(tape.charAt(i));
                k--;
            }
        }
        return "";
    }
}

