import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int racecar(int target) {
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);
        boolean[] visited = new boolean[20001];
        visited[0] = true;
        int step = 1;
        while (!queue.isEmpty()) {
            for (int i = queue.size(); i > 0; i--) {
                int pos = queue.poll();
                if (pos == target) return step;
                int speed = Math.abs(pos);
                if (speed * 2 <= target && !visited[target - speed * 2]) {
                    queue.offer(target - speed * 2);
                    visited[target - speed * 2] = true;
                }
                if ((1 + pos) / 2 != speed && !visited[2 * speed + pos]) {
                    queue.offer(2 * speed + pos);
                    visited[2 * speed + pos] = true;
                }
            }
            step++;
        }
        return -1;
    }
}

