public class Solution {
    public int flipgame(int[] fronts, int[] backs) {
        Set<Integer> frontSet = new HashSet<>();
        for (int front : fronts) {
            frontSet.add(front);
        }

        int result = Integer.MAX_VALUE;
        for (int i = 0; i < fronts.length; i++) {
            if (!frontSet.contains(backs[i])) {
