import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        if (preorder.length == 0) return null;

        TreeNode root = new TreeNode(postorder[postorder.length - 1]);
        int idx = preorder.length - 1;

        for (int i : preorder) {
            if (i == postorder[postorder.length - 1]) {
                idx--;
                break;
            }
        }

        int[] leftPre = new int[idx + 1];
        System.arraycopy(preorder, 0, leftPre, 0, idx + 1);
        int[] rightPost = new int[preorder.length - idx - 2];
        System.arraycopy(postorder, 0, rightPost, 0, preorder.length - idx - 2);

        root.left = constructFromPrePost(leftPre, rightPost);
        root.right = constructFromPrePost(new int[idx], postorder, preorder, idx + 1, preorder.length - 1);

        return root;
    }

    public TreeNode constructFromPrePost(int[] preorder, int[] postorder, int start, int end) {
        if (start > end) return null;

        TreeNode node = new TreeNode(postorder[end]);
        int idx = start;

        for (int i : preorder) {
            if (i == postorder[postorder.length - 1]) {
                idx--;
                break;
            }
        }

        int[] leftPre = new int[idx - start];
        System.arraycopy(preorder, start, leftPre, 0, idx - start);
        int[] rightPost = new int[end - start + 1];
        System.arraycopy(postorder, start, rightPost, 0, end - start + 1);

        node.left = constructFromPrePost(leftPre, rightPost);
        node.right = constructFromPrePost(new int[idx - start], postorder, start, idx - 1);

        return node;
    }
}

