public class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        Map<Integer, Set<Integer>> busStopsByBus = new HashMap<>();
        for (int i = 0; i < routes.length; i++) {
            for (int stop : routes[i]) {
                busStopsByBus.computeIfAbsent(i, k -> new HashSet<>()).add(stop);
            }
        }

        int ans = -1;
        for (Map.Entry<Integer, Set<Integer>> entry : busStopsByBus.entrySet()) {
            if (entry.getValue().contains(source) && entry.getValue().contains(target)) {
                ans = Math.max(ans, 1 + getBusNumber(entry.getKey()));
            }
        }

        return ans;
    }

    private int getBusNumber(int bus) {
        for (int i = 0; i < routes.length; i++) {
            if (Arrays.equals(routes[i], new int[] {bus})) {
                return i;
            }
        }
        return -1;
    }
}

