public class Solution {
    public int mirrorReflection(int p, int q) {
        int gcd = gcd(p, q);
        return (p / gcd) % 2 == 0 ? 1 : (q / gcd) % 2 == 0 ? 2 : 0;
    }

    private int gcd(int a, int b) {
        if (b == 0) {
            return a;
        }
        return gcd(b, a % b);
    }
}

