// #2022_03_27_Time_26_ms_(85.40%)_Space_42.6_MB_(95.75%)
import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        Integer[][] workers = new Integer[quality.length][2];
        for (int i = 0; i < quality.length; i++) {
            workers[i] = new Integer[]{wage[i], quality[i]};
        }
        Arrays.sort(workers, Comparator.comparingInt(a -> a[1]).thenComparingInt(a -> a[0]));

        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> a - b);
        double minCost = Double.MAX_VALUE;
        int totalQuality = 0;
        for (int i = 0; i < k; i++) {
            totalQuality += workers[i][1];
            pq.offer(workers[i][0]);
        }

        while (!pq.isEmpty()) {
            double cost = pq.peek() / (double)totalQuality;
            minCost = Math.min(minCost, cost);
            pq.poll();
            if (pq.size() < k - 1) {
                totalQuality -= workers[k-1][1];
                for (int i = k; i < quality.length; i++) {
                    if (workers[i][0] <= minCost * totalQuality) {
                        pq.offer(workers[i][0]);
                        break;
                    }
                }
            }
        }

        return minCost;
    }
}

