import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numFactoredBinaryTrees(int[] arr) {
        Arrays.sort(arr);
        Map<Integer, Integer> dp = new HashMap<>();
        dp.put(0, 1);
        int mod = (int) Math.pow(10, 9) + 7;
        for (int i : arr) {
            int count = 0;
            int j = 0;
            while (j < i) {
                if (i % j == 0 && dp.containsKey(j) && dp.containsKey(i / j)) {
                    count += dp.getOrDefault(j, 0) * dp.getOrDefault(i / j, 0);
                }
                j++;
            }
            dp.put(i, count + (dp.getOrDefault(i, 0) == null ? 1 : dp.get(i)));
        }
        int res = 0;
        for (int i : arr) {
            res += dp.getOrDefault(i, 0);
        }
        return (int) ((long) res % mod);
    }
}

